import React, { useEffect, useState } from 'react';
import axios from 'axios';
import base_url from '../../api/bootapi';

const List=()=>{

var _ = require('lodash');

const pageSize=10;

const [workData, setWorkData]=useState();    


useEffect(()=>{
    axios.get(`${base_url}/user/workDetails/`).then((res)=>{
        console.log(res.data);
        setWorkData(res.data);
    });
},[]);

const pageCount=workData ? Math.ceil(workData.length/pageSize) : 0;
if(pageCount===1) return null;
const pages = _.range(1, pageCount+1);


return <div>{
                !workData ? ("No Work Found") : (
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Salary</th>
                                <th>Work</th>
                                <th>Location</th>
                                <th>Work Type</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                workData.map((workDescription, index)=>(
                                    <tr key={index}>
                                        <td>{workDescription.workAmount}</td>
                                        <td>{workDescription.description}</td>
                                        <td>{workDescription.location}</td>
                                        <td>{workDescription.category}</td>
                                    </tr>
                                ))
                            }
                        </tbody>
                    </table>
                )
            }
            <nav className="d-flex justify-content-center">
                <ul className="pagination">
                    {
                        pages.map((page)=>(
                            <li className="page-link">{page}</li>
                        ))
                    }
                   
                </ul>
            </nav>
        </div>
    
}
export default List;
